// src/entities/Duckling.js
import Matter from 'matter-js';
import React from 'react';

const Duckling = () => {
  const duckling = {
    body: Matter.Bodies.rectangle(100, 300, 50, 50, {
      label: 'duckling',
      friction: 0.1,
      restitution: 0.8,
    }),
    renderer: <DucklingRenderer />,
  };
  return duckling;
};

const DucklingRenderer = () => {
  const style = {
    position: 'absolute',
    width: '50px',
    height: '50px',
    backgroundImage: 'url(/assets/duckling.png)',
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    transform: 'translate(-25px, -25px)', // Center the image
  };

  return <div style={style} />;
};

export default Duckling;
